				TWM.remove ('LANGUAGE');
			
			var menuPos = TWM.settings.gui.comboboxes['menuPos'].getValue ();
			if (menuPos != undefined)
				TWM.set ('MENU_POSITION', menuPos);
			
			TWM.showMessage (TWM.lang.saved, UserMessage.TYPE_SUCCESS);
