	TWM.Blinker = {
		init:function () {
			// delete old menu event handlers
			if (EventHandler.removeListener) {
				EventHandler.removeListener ('player-toread-messages');
				EventHandler.removeListener ('player-toread-reports');
				EventHandler.removeListener ('player-toread-townforum');
				EventHandler.removeListener ('player-toread-inventory');
			} else {
				EventHandler.unlisten ('player-toread-messages');
				EventHandler.unlisten ('player-toread-reports');
				EventHandler.unlisten ('player-toread-townforum');
				EventHandler.unlisten ('player-toread-inventory');
			}
			
			// create new event handler function for blinking
			var blinkBottom = function (type, toRead) {
				toRead = toRead || type;
				return function () {
					WestUi.Blinker.start (type, {
						'start':function () {
							var link = {
								Forum:(TWM.menu.contains ('Forum') ? 'Forum' : 'Stadt'),
								Berichte:(TWM.menu.contains ('Berichte') ? 'Berichte' : 'Telegramme'),
								barkeeper:(TWM.menu.contains ('QuestBarkeeper') ? 'QuestBarkeeper' : 'Quests'),
								indian:(TWM.menu.contains ('QuestIndian') ? 'QuestIndian' : 'Quests'),
								lady:(TWM.menu.contains ('QuestLady') ? 'QuestLady' : 'Quests'),
								sheriff:(TWM.menu.contains ('QuestSheriff') ? 'QuestSheriff' : 'Quests')
							};
							var el = $('.TWM_highlight.' + (link[type] || type) );
							if (Config.get ('gui.animations') ) {
								el.animate ({'opacity':1}, {'queue':false, 'duration':600});
								if ('city' === type) {
									$('#windows div.tow_forumhighlight').animate ({'opacity':1}, {'queue':false, 'duration':600});
									if (!el.length)
										$('.TWM_highlight.Stadt').animate ({'opacity':1}, {'queue':false, 'duration':600});
								}
							} else {
								el.css ('opacity', 1);
								if ('city' === type) {
									$('#windows div.tow_forumhighlight').css ('opacity', 1);
									if (!el.length)
										$('.TWM_highlight.Stadt').css ('opacity', 1);
								}
							}
						},
						
						'stop':function (force) {
							var link = {
								Forum:(TWM.menu.contains ('Forum') ? 'Forum' : 'Stadt'),
								Berichte:(TWM.menu.contains ('Berichte') ? 'Berichte' : 'Telegramme'),
								barkeeper:(TWM.menu.contains ('QuestBarkeeper') ? 'QuestBarkeeper' : 'Quests'),
								indian:(TWM.menu.contains ('QuestIndian') ? 'QuestIndian' : 'Quests'),
								lady:(TWM.menu.contains ('QuestLady') ? 'QuestLady' : 'Quests'),
								sheriff:(TWM.menu.contains ('QuestSheriff') ? 'QuestSheriff' : 'Quests')
							};
							var el = $('.TWM_highlight.' + (link[type] || type) );
							if (Config.get ("gui.animations") ) {
								el.animate ({'opacity':0}, {'queue':false, 'duration':600});
								if ('city' === type) {
									$('#windows div.tow_forumhighlight').animate ({'opacity':0}, {'queue':false, 'duration':600});
									if (!el.length)
										$('.TWM_highlight.Stadt').animate ({'opacity':0}, {'queue':false, 'duration':600});
								}
							} else if (force) {
								el.css ('opacity', 0);
								if ('city' === type) {
									$('#windows div.tow_forumhighlight').css ('opacity', 0);
									if (!el.length)
										$('.TWM_highlight.Stadt').css ('opacity', 0);
								}
							}
						},
						
						'check':function () {
							return Character.read[toRead];
						}
					});
				};
			};
			
			// add new event handlers for blinking
			EventHandler.listen ('player-toread-messages',	blinkBottom ('Telegramme', 'messages') );
			EventHandler.listen ('player-toread-reports',	blinkBottom ('Berichte', 'reports') );
			EventHandler.listen ('player-toread-townforum',	blinkBottom ('Forum', 'townforum') );
			EventHandler.listen ('player-toread-inventory',	blinkBottom ('Inventar', 'inventory') );
			EventHandler.listen ('player-toread-advent',	blinkBottom ('Advent', 'advent') );
			EventHandler.listen ('player-toread-barkeeper',	blinkBottom ('barkeeper') );
			EventHandler.listen ('player-toread-indian',	blinkBottom ('indian') );
			EventHandler.listen ('player-toread-lady',		blinkBottom ('lady') );
			EventHandler.listen ('player-toread-sheriff',	blinkBottom ('sheriff') );
			EventHandler.listen ('player-toread-forts',		blinkBottom ('Fortuebersicht', 'forts') );
			EventHandler.listen ('player-toread-trader',	blinkBottom ('Haendler', 'trader') );
			
			// add new blinkers
			WestUi.Blinker.animation = {};
			for (el in Character.read)
				if (Character.read[el])
					EventHandler.signal('player-toread-' + el);
		}
	};
	
	
